import { useEffect, useState } from 'react'
import { getSkills, getAbout } from '../../Helpers'

function About() {
    const [skills, setSkills] = useState([])
    const [about,setAbout] = useState([])
    useEffect(() => {
        let mounted = true;

        getAbout()
        .then( items => {
            if(mounted) {
                setAbout(items)
            }
        })

        getSkills()
        .then( items => {
            if(mounted) {
                setSkills(items)
            }
        })
        return () => mounted = false
    }, [])
console.log(about.profileImage.name)
