                            <img src='' alt="lorem" />

                        </div>

                    </div>
                    <div className="col-md-8">
                        <h1>Lorem Ipsum</h1>
                        {about.description}

                        <hr />

                        <h3>Lorem</h3>
                        <ul>
                            {skills.map( item => {
                                return (
                                    <li key={item.id}>{item.entry}</li>
                                )
                            })}
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default About
